#include "../general_include.h"

using namespace std;
class Solution {
public:

    int data_t[52];

    bool checkReq(string s_sub, string t){
        
        int data_s_sub[52];

        for(int i = 0; i < 52; i++){
            data_s_sub[i] = 0;
        }

        // count s_sub
        for(int i = 0; i < s_sub.size(); i++){
            int cur_idx = s_sub[i] - 'A';
            if(cur_idx > 25){
                cur_idx = cur_idx - 6;
            }
            data_s_sub[cur_idx]++;
        }
        

        // check if satisfy
        for(int i = 0; i < 52; i++){
            if(data_s_sub[i] < data_t[i]){
                return false;
            }
        }
        return true;
    }


    string minWindow(string s, string t) {
        for(int i = 0; i < 52; i++){
            data_t[i] = 0;
        }

        // count t
        for(int i = 0; i < t.size();i++){
            int cur_idx = t[i] - 'A';
            if(cur_idx > 25){
                cur_idx = cur_idx - 6;
            }
            data_t[cur_idx]++;
        }

        int min_len = INT_MAX;
        pair<int,int> min_pair;

        bool global_hit = false;

        int l = 0;
        int r = 0;

        while(l < s.size()){
            bool hit=false;   // hit flag
            int temp_r;

            // expanding right perimeter
            for (int j = r; j < s.size(); j++){
                if(checkReq(string(s.c_str() + l, s.c_str() + j + 1),t)){
                    hit=true;
                    global_hit = true;
                    r = j;
                    break;
                }
            }

            //shrinking left perimeter
            while(hit == true && l<=r && checkReq(string(s.c_str()+l+1, s.c_str()+r+1), t)  ){
                l++;
            }

            if(hit==true){
                if(r-l+1 < min_len){
                    min_len = r-l+1;
                    min_pair.first = l;
                    min_pair.second = r;
                }
                l++;
                r++;
            }else{
                break;
            }

        }

        if(global_hit == true)
            return string(s.c_str()+min_pair.first, s.c_str()+min_pair.second+1);
        else
            return string("");

    }
};



int main() {
    auto start = std::chrono::high_resolution_clock::now();
    
    
    
    Solution a;
    std::string s("");
    std::string t("");
    a.minWindow(s, t);

    // End the timer
    auto end = std::chrono::high_resolution_clock::now();

    // Calculate the duration
    std::chrono::duration<double> duration = end - start;

    // Print the runtime in seconds
    std::cout << "Runtime: " << duration.count() << " seconds" << std::endl;

    return 0;
}
